static int sf_glad_wgl_find_core_wgl(void) {
    int major = 1, minor = 0;
    SF_GLAD_WGL_VERSION_1_0 = (major == 1 && minor >= 0) || major > 1;
    return GLAD_MAKE_VERSION(major, minor);
}

